@-moz-document domain("web.controller.bot") {
    .el-form--label-left {
    background: #141414;
}
.newpost {
    background: #141414;
}
.newpost-wrapper {
    background: #141414;
}
.keyboard-button {
    background: #141414;
}
.el-button {
    background: #141414;
}
.el-button--primary.keyboard-button {
    background: #141414;
}
.el-input__inner {
    background: #141414;
}
.el-popover {
    background: #141414;
}
.emoji-row-wrapper {
    background: #141414;
}
.ql-blank p {
    background: #5984;
}
.ql-editor p {
    color: #999;
}
.emoji-picker {
    background-size: #999;
}
.el-switch__core {
    background: #3e3b44;
}
.el-switch.is-checked .el-switch__core {
    background: #06315c;
}
.footer span {
    background: #19182d;
}

}
